INSERT INTO `rh_contratos` (`id`, `n_contrato`, `consultoria`, `objetivo`, `alcance`, `actividades`, `metodologia`, `fecha_contrato`, `fecha_inicio`, `fecha_fin`, `tiempo_contrato`, `monto_total`, `monto_total_l`, `productos`, `cumplimiento`, `status`, `aprobacion_coordinadora`, `fecha_aprobacion_coordinadora`, `aprobacion_directora`, `fecha_aprobacion_directora`, `coordinadora_id`, `directora_id`, `user_id`, `oficina_id`, `created_at`, `updated_at`) VALUES
	(6, 'CS-09-2018', 'Apoyo Logístico al FONGI', 'Deberá coordinar la Secretaría Técnica del Foro de Ong´s Internacionales FONGI', 'Brindar apoyo logístico y administrativo para la coordinación de actividades en el Foro de Ongs Internacionales', '- Redacción y ayuda memoria\r\n- Elaboración de resúmenes ejecutivos e informes\r\n- Llevar un registro ordenado y ágil de la correspondencia\r\n- manejar la agenda\r\n- coordinar reuniones\r\n- apoyo administrativo y logístico de actividades planificadas\r\n- comuni', 'Coordinará con la Representación País el trabajo que realice, así como los informes.\r\ncoordinará la red de datos e informará a los y las miembros del FONGI\r\nLlevará un control de las actividades en base al plan de trabajo', '2018-02-01', '2018-02-01', '2019-02-28', '392', '90000', 'Noventa mil quetzales exactos ', 'Producto 1 Informe mensual\r\nProducto 2 Informe mensual\r\nProducto 3 Informe mensual\r\nProducto 4 Informe mensual\r\nProducto 5 Informe mensual\r\nProducto 6 Informe mensual\r\nProducto 7 Informe mensual\r\nProducto 8 Informe mensual\r\nProducto 9 Informe mensual\r\n', '', '0', '1', '2018-03-08', '0', '0000-00-00', 17, NULL, 32, 1, '2018-03-08 23:20:01', '2018-04-12 02:14:00'),
	(7, 'CS10-2018', 'Apoyo legal en las actividades de cierre de la oficina de Paraguay', 'Brindar acompañamiento a la administradora financiera que funge como representante administrativa de We Effect en todas las actividades que concierne al cierre de la oficina de Paraguay. ', 'Acta de cierre, cierre de MH, Municipalidad, IPS, MJT', 'Acompañamiento de las transacciones bancarias\r\nFirmas legales para uso del poder para cierre en Ministerios y otros organismos\r\nActa de cierre de la oficina en el Registro Público', 'Reuniones periódicas con la administradora financiera para ver el avance en las gestiones legales del cierre ', '2018-03-01', '2018-03-01', '2018-12-31', '305', '5000000', 'cinco millones', 'Dos informes y uno de cierre', '', '0', '1', '2018-05-14', '0', '0000-00-00', 17, NULL, 35, 6, '2018-04-10 18:41:23', '2018-05-14 22:15:02'),
	(8, 'CS-019-2018', 'Asesoramiento y servicio legal para la Legalización de la  Representación de We Effect en Bolivia ', 'Realizar la recopilación, sistematización de información, análisis y armado de carpetas en correspondencia a los requisitos y formatos solicitados por el Ministerio de Relaciones Exteriores  y el Viceministerio de Inversión Pública', 'a)	La revisión documentaria de la información enviada a los correspondientes Ministerios (medio magnético e impreso)\r\nb)	La sistematización y el análisis \r\nc)	Elaboración del informe de la gestión 2017 de acuerdo a formato \r\nd)	La revisión documentaria, sistematización y análisis de acuerdo a formatos establecidos del Viceministerio de Inversión Pública y Financiamiento Externo – VIPFE, para la renovación del Registro Único de ONG.\r\ne)	Se realizará el armado físico de las carpetas, la impresión respectiva y la entrega del documento final en formato magnético y físico.\r\n', '(a)	We Effect comparte toda la documentación relevante para el trabajo de la consultoría del período señalado, \r\n(b)	We Effect facilitará información referida a lo presupuestario- administrativo requerido en el formato \r\n(c)	La consultora revisará detenidamente los documentos de la propuesta en base a los criterios estipulados y sobre la base de su propia experiencia, \r\n(d)	Acompañamiento, diálogo y co-conducción entre el/la  consultor/a y la Representante País de We Effect.\r\n', 'La consultoría se desarrollará de manera coordinada e interactiva con la Representante País de We Effect en Bolivia –  Sandra Bustamante, basada en las tareas y requisitos establecidos, por tanto y de acuerdo al objetivo de la presente consultoría', '2018-03-12', '2018-03-15', '2018-06-15', '92', '12355', 'Doce mil trescientos cincuenta y cinco 00/100 Bolivianos', '1.- Informe de avance.\r\n2.- Informe de avance.\r\n3.- Informe final y formatos aprobados por la representación país.', '', '0', '0', '0000-00-00', '0', '0000-00-00', NULL, NULL, 43, 3, '2018-05-15 16:00:34', '2018-05-15 18:47:27'),
	(9, 'CS-020-2018', 'Asesoramiento y servicio legal para la Legalización de la  Representación de We Effect en Bolivia ', 'Realizar asesoramiento y prestar un servicio legal para la Renovación del Acuerdo Marco de Cooperación Básica con el Ministerio de Relaciones Exteriores; y Renovación del Registro en el Viceministerio de Inversión Pública y Financiamiento Externo - VIPFE.\r\nAbarca, además, los factores y obligaciones con los que We Effect  debe cumplir y que se deben considerar desde la perspectiva de la legislación de Bolivia, en cuanto a aspectos tributarios, bancarios, seguro social, Ministerio de Trabajo y las AFPs Futuro y Previsión.\r\n', 'Ministerio de Relaciones Exteriores:\r\n- Acreditación del Poder Legal y presentación del mismo para  cambio de Representante Legal.\r\n- Entrevistas con la responsable del trámite para reencausar el proceso para la firma del AMCB.\r\n- Armando de carpeta con documentación legal y técnica que subsane las observaciones que surjan al proceso de renovación.\r\n- Presentación de memoriales y/o cartas hasta la firma del AMCB, seguimiento al proceso de renovación hasta la firma del AMCB.\r\n\r\nViceministerio de Inversión Pública y Financiamiento Externo (VIPFE):\r\n- Presentación de documentos  para el cambio de representante Legal.\r\n- Gestionar el desarchivo de la documentación.\r\n- Seguimiento al proceso de envió de informe por el VIPFE a la Cancillería para firmar AMCB.\r\n- Iniciar la Renovación del Registro de ONG, acreditando toda la documentación necesaria.\r\n- Seguimiento del proceso hasta la conclusión de la  Renovación del Registro.\r\n\r\nMinisterio del Trabajo y Seguridad Social:\r\n- Iniciar el Registro Obligatorio del Empleador (ROE) hasta su conclusión.\r\n- Regularización de la situación legal de We Effect ante el Ministerio del Trabajo.\r\n\r\nBancos:\r\n- Cambio de Representación Legal.\r\n- Habilitación de Cuentas Bancarias Institucionales.\r\n\r\nAFPs Futuro, AFPs Prevision y Seguro Universitario:\r\n- Cambio de Representación\r\n-  Regularización situación  legal.\r\n', '(a)	We Effect comparte toda la documentación relevante para el trabajo de la consultoría del período señalado, \r\n(b)	La consultora revisará detenidamente los documentos de la propuesta en base a los criterios estipulados y sobre la base de su propia experiencia, \r\n(c)	Acompañamiento, diálogo y co-conducción entre el/la  consultor/a y la Representante País de We Effect.\r\n', 'La consultoría se desarrollará de manera coordinada e interactiva con la Representante País de We Effect en Bolivia –  Sandra Bustamante, basada en las tareas y requisitos establecidos por tanto y de acuerdo al objetivo de la presente consultoría', '2018-03-15', '2018-03-15', '2018-06-15', '92', '20880', 'Veinte mil ochocientos ochenta 00/100', 'Informe de avance  aprobado por la representación país\r\nInforme de avance y entrega de documentos finales por cada trámite aprobado por la representación país.\r\nInforme de avance y entrega de documentos finales por cada trámite aprobado por la representación país.', NULL, '0', '0', '0000-00-00', '0', '0000-00-00', NULL, NULL, 44, 3, '2018-05-16 20:23:01', '2018-05-16 20:23:01'),
	(10, '18', 'Mapeo de Donantes y Proveedores', 'Elaborar un mapeo de donantes y proveedores de recursos relevantes para el trabajo de las organizaciones contrapartes de We Effect en Paraguay a fin de apoyar la diversificación y gestión de recursos para su auto-sostenibilidad.', 'Identificar y caracterizar donantes y proveedores de recursos con presencia en el país (ámbito nacional, territorial e internacional), relevantes para las líneas de trabajo de las contrapartes de We Effect en Paraguay (Programa de VIVHA y Programa de SEMBRANDO).\r\n\r\nFortalecer las capacidades de las contrapartes para poder realizar el mismo proceso de elaborar mapeos.\r\n', 'Preparación de insumos e información para el taller con referentes de organizaciones contrapartes de We Effect Paraguay\r\nTaller 1:  Con referentes de contrapartes de We Effect  para realizar reflexión sobre el contexto de cooperación en Paraguay.  Los ODS, la agenda 2030, etc.  Ámbitos de la cooperación. Consensuar matriz para colectar información.\r\nCompilar información disponible, identificar donantes-cooperantes, agendar entrevistas \r\nRealizar entrevistas  a donantes o contactos\r\nProcesamiento de la información relevada (desgrabación de entrevistas, construcción de matrices de análisis, clasificación y ordenamiento de documentos y elaboración de  documento.) Taller 2: Presentación  de lo colectado,  compartir las  técnicas y metodologías para la recolección de información. Consenso y validación  de los datos. \r\nPresentación de un primer Borrador de  documento\r\nRealizar una reunión/Taller 3  de  presentación de lo colectado, validar la información según el interés de las contrapartes.  Recomendaciones\r\nAjustar y corregir el documento final. (Word)\r\nPresentación del documento final\r\n \r\n', 'i.	Se espera la elaboración de un mapeo que identifica y caracteriza donantes y proveedores de recursos en el país en el ámbito nacional y territorial y al nivel internacional, quienes son típicamente agencias de cooperación, embajadas, organizaciones no-gubernamentales, cooperativas, sindicatos, empresas privadas e instituciones del estado y multilaterales etc), entre otras.\r\n\r\nii.	Se debe concebir recursos en el sentido más amplio, incluyendo, pero no limitado a, recursos financieros, recursos técnicos, recursos humanos, becas, cursos gratuitos, trabajo voluntariado, servicios gratuitos, bienes materiales etc.\r\n\r\niii.	La estructura y partes del mapeo se destaca abajo en la sección de productos. En cuanto al análisis, se debe profundizar y sistematizar análisis de cada donante/proveedor con énfasis en lo siguiente:\r\na.	El quehacer y las áreas y enfoques de trabajo\r\nb.	Las principales estrategias, proyectos, acciones, procesos de incidencia (si hay) \r\nc.	Las tendencias a futuro.\r\nd.	Los mecanismos y las modalidades de cooperación. (formatos, periodicidad de los llamados) \r\ne.	Datos e información bibliográfica sobre cada organización identificada.\r\nf.	Conclusiones y recomendaciones útiles para las organizaciones (se debe definir esto en conjunto con las organizaciones\r\n', '2018-07-31', '2018-07-31', '2018-09-30', '61', '3500', 'cuatro mil ciento diecisiete dólares con sesenta y cinco centavo', 'Producto 1: Informe de Mapeo de Donantes y proveedores de recursos. El informe final debe ser un documento de identificación y caracterización de no más de 30 páginas máximo conteniendo los aspectos descritos en el objetivo.  \r\nEstructura del documento (general)\r\na)	Resumen ejecutivo\r\nb)	Introducción/justificación\r\nc)	Contexto de la cooperación al desarrollo en Paraguay en relación a contexto político y económico y las tendencias generales de cooperación en el país y América Latina más generalmente. \r\nd)	Características generales de los diferentes sectores de donantes y proveedores de recursos y sus particularidades históricas y recientes.\r\ne)	Resultados: Identificación y caracterización de donantes y proveedores de recursos según los criterios definidos en el punto III de la metodología.\r\nf)	Recomendaciones: Organizaciones más relevantes y estratégicos para las organizaciones contrapartes.\r\nSe entregarán los borradores del informe necesarios para la discusión y retroalimentación hasta tener un documento final de consensuado por las diferentes partes.\r\n\r\nProducto 2: Tabla comparativa de las organizaciones prioritarias por sector, los recursos ofrecidos y mecanismos identificados. (Herramienta para ser diseñado en conjunto con el/la consultora, las organizaciones contrapartes We Effect y el Coordinador de la Movilización de Recursos en base a los criterios establecidos, incluyendo organizaciones que priorizan un enfoque de género y derechos, entre otros--anexo I).\r\n\r\nProducto 3: Base de datos en Excel con la información y los datos de todas las organizaciones / instancias identificadas, incluso nombres de personas de contacto etc.\r\n', NULL, '0', '0', '0000-00-00', '0', '0000-00-00', NULL, NULL, 50, 6, '2018-07-31 18:43:55', '2018-07-31 18:43:55');
